Treliński (Piotr) 
DJ and producer from Poland, Warsaw.
Born in 1993. His adventure with music production started in 2008, few hours after seeing movie "Berlin Calling", about Paul Kalkbrenner's career. He went back to his house, with clear vision of his future. After that began a long journey through genres, styles, instruments and ways of developing sound, together with  creation of his own self. Although his journey continues today, he managed to find part of his soul in Dark and melodic waves of techno music, turning his back from mainstream EDM industry.

My favourite genres are:&#13;
Techno, Tech House, Minimal, Ambient, Soundtrack, Melodic & Chill. &#13;
Im trying to make different types and genres to create my own recognisable style in the world of electronic music. Currently focusing on pure Berlin Techno genre.&#13;
